    }
  };
  const [toggler, setToggler] = useState(false);

  return (
    <Loader>
      <FsLightbox
        toggler={toggler}
        sources={["https://www.youtube.com/watch?v=sU3FkzUKHXU"]}
      />
      <HeaderFive
        data={dataNav}
        scrollToSection={scrollToSection}
      />
      <ParallaxAppStyle ref={home} />
      <WhoWeAreTwo
        title="Who we are"
        tagline="The world at your fingertips">
        We are a fully in-house digital agency focusing on branding, marketing,
        web design and development with clients ranging from start-ups, Lorem
        ipsum dolor sit amet, consectetur adipiscing elit. Sed varius quam ut
        magna ultricies pellentesque.
      </WhoWeAreTwo>
      <OurTeam
        title="EXPLORA TODO LO QUE TENEMOS PARA OFRECERTE"
        tagline=""
        ref={service}
      />
      <AboutAppStyle ref={feature} />
      <ContactApp ref={contact} />
      <FooterTwo />
    </Loader>
  );
};

export default AppStyle;
